def solve(string, k):
    words = string.split()
    result = []
    for word in words:
        if len(word) != k:
            result.append(word)
    return " ".join(result)

def solve(string, k):
    words = string.split()
    filtered_words = [word for word in words if len(word) != k]
    return " ".join(filtered_words)

